package com.gladurbad.nebula.check.combat;

import com.gladurbad.nebula.Nebula;
import com.gladurbad.nebula.check.Check;
import com.gladurbad.nebula.data.PlayerData;
import net.minecraft.server.v1_8_R3.AxisAlignedBB;
import org.bukkit.Bukkit;
import org.bukkit.craftbukkit.v1_8_R3.entity.CraftEntity;
import org.bukkit.entity.Player;
import org.bukkit.event.EventHandler;
import org.bukkit.event.Listener;
import org.bukkit.event.entity.EntityDamageByEntityEvent;
import org.bukkit.util.Vector;

import java.util.Objects;

public class Reach extends Check implements Listener {

    public Reach(final String name) {
        super(name);
    }

    @EventHandler
    public void onEntityDamageByEntity(final EntityDamageByEntityEvent event) {
        if (event.getDamager() instanceof Player) {
            final PlayerData playerData = Nebula.instance.getPlayerDataManager().getPlayerData((Player) event.getDamager());

            if (playerData != null) {
                final Vector attackerVector = playerData.getBukkitPlayer().getLocation().toVector().setY(0);
                final Vector victimVector = event.getEntity().getLocation().toVector().setY(0);

                final double distance = attackerVector.distance(victimVector);

                final AxisAlignedBB boundingBox = ((CraftEntity) event.getEntity()).getHandle().getBoundingBox();

                final double widthX = Math.abs(boundingBox.a - boundingBox.d) / 2;
                final double widthZ = Math.abs(boundingBox.c - boundingBox.f) / 2;
                final double girth = Math.hypot(widthX, widthZ);

                double reach = distance - girth;

                /*
                Here is where we brute force interpolation, In order to detect any type of reach modification

                Special thanks to
                https://github.com/NikV2/BruteForceInterpolation

                This idea officially originated by Iced.
                 */
                for (int i = 0; i < bruteForceInterpolation(reach); i++) reach /= bruteForceInterpolation(reach);

                if (reach > MAX_REACH) {

                    /*
                    We need a buffer of 10 as shown in the funkemunky reach tutorial
                     */
                    if (++playerData.getDataStorage().reachVerbose > 10) {
                        flag(playerData, String.format("reach=%.4f", reach));
                    }
                } else {
                    playerData.getDataStorage().reachVerbose = 0;
                }
            }
        }
    }

    private double bruteForceInterpolation(double reach) {

        return reach *= 600 * 14 / 73 + 41 - 512 + 5 * 500 / 2 * 2
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                % 1 * 599D / 2 % 96 + 1D * 9521 / 2 * 200 % .7 / 2 * 2000
                % 1 * 4.71D / 2 * 1 * .001D % 61 / 5 * 421D
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                % 1 * 599D / 2 % 96 + 1D * 9521 / 2 * 200 % .7 / 2 * 2000
                / 600 * 14 / 73 + 41 - 512 + 8 * 500 / 2 * 2
                / Double.MAX_VALUE * Double.NaN % Double.MIN_EXPONENT * 1000
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                % 1 * 599D / 2 % 96 + 1D * 9521 / 2 * 200 % .7 / 2 * 2000
                / 600 * 14 / 73 + 41 - 512 + 1 * 500 / 2 * 2
                / Double.MAX_VALUE * Double.NaN % Double.MIN_EXPONENT * 1000
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                * 50 % 2 / 6113 * Math.PI / Math.E * 5000 % Math.random() * .2
                / 100 / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                / 600 * 14 / 73 + 41 - 512 + 321 * 500 / 2 * 2
                % 1 * 599D / 2 % 96 + 1D * 9521 / 2 * 200 % .7 / 2 * 2000
                % 1 * 4.71D / 2 * 845 * .001D % 61 / 5 * 421D
                * 50 % 2 / 6113 * Math.PI / Math.E * 5000 % Math.random() * .2
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                / 100 / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                / 600 * 14 / 73 + 41 - 512 + 3 * 500 / 2 * 2
                / Double.NEGATIVE_INFINITY * 9412 % 1 / Double.MAX_EXPONENT
                % 1 * 599D / 2 % 96 + 1D * 9521 / 2 * 200 % .7 / 2 * 2000
                % 1 * 4.71D / 2 * Double.MAX_VALUE * .001D % 61 / 5 * 421D;
    }

    private static final double MAX_REACH = 3.;
}
